import React from 'react';

import PageHeader from '../../components/PageHeader';

import './styles.css';

function Home() {
  return (
    <div id="page-home" className="container">
       <PageHeader />


       <main>
         <article className="home-item">
           <header>
             <div>
               <strong></strong>
             </div>
           </header>
         </article>
       </main>
    </div>    
  )
}

export default Home;
